gR9(){return"Data collection on our website"},
gRa(){return'Cookies\n\nSome of the websites use so-called cookies. Cookies do not damage your computer and do not contain viruses. Cookies serve to make our offer more user-friendly, effective and secure. Cookies are small text files that are stored on your computer and saved by your browser.\n\nMost of the cookies we use are so-called "session cookies". They are automatically deleted at the end of your visit. Other cookies remain stored on your end device until you delete them.These cookies enable us to recognize your browser on your next visit.\n\nYou can set your browser so that you are informed about the setting of cookies and only allow cookies in individual cases, acceptance exclude cookies for certain cases or in general and activate the automatic deletion of cookies when closing the browser.If cookies are deactivated, the functionality of this website may be restricted.\nServer log files\n\nThe provider of the pages collects and saves automatically Information in so-called server log files, which your browser automatically transmits to us.These are:\n\n Browser type and Browser version\n Operating system used\n Referrer URL\n Host name of the accessing computer\n Time of server request\n IP address\n\nThis data cannot be assigned to specific individuals. This data is not merged with other data sources. We reserve the right to subsequently check this data if we become aware of specific indications of illegal use. The data will be deleted after seven days.\nContact form\n\nIf you send us inquiries via the contact form, your details from the inquiry form, including the contact details you provided there, will be stored by us for the purpose of processing the inquiry and in the event of follow-up questions. We do not pass on this data without your consent.\n\nThe processing of the data entered in the contact form is therefore exclusively based on your consent (Art. 6 Para. 1 lit. a DSGVO). You can revoke this consent at any time. An informal message by e-mail to us is sufficient. The legality of the data processing operations that took place up to the point of revocation remains unaffected by the revocation.\n\nThe data you enter in the contact form will remain with us until you request deletion, revoke your consent to storage or the purpose for data storage no longer applies (e.g. after completion of the processing your request). Mandatory legal provisions - in particular retention periods - remain unaffected.'},
